const API_URL = 'http://localhost:3000/authenticate' // process.env.REACT_NATIVE_API_URL + '/authenticate'

const LogIn = (user) => {
    fetch(API_URL, {
        method: 'POST', // or 'PUT'
        body: JSON.stringify({
            email: 'paco@mu-project.org',
            password: 'aaBB1234*'
        }), // data can be `string` or {object}!
        headers:{
          'Content-Type': 'application/json'
        },
        mode: 'no-cors'
    })
    .then(res => res.json())
    .catch(error => console.error('Error:', error))
    .then(response => {
        console.log('Success:', response)
        const respon = response
        return respon
    });

}

export default LogIn
